### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Search Algorithms**
   - **Depth-First Search (DFS)**
     - Explores as far as possible along each branch before backtracking.
     - Uses a stack to keep track of nodes.
   - **Breadth-First Search (BFS)**
     - Explores all neighbors at the present depth before moving on to nodes at the next depth level.
     - Uses a queue to keep track of nodes.
   - **Best-First Search**
     - Uses a priority queue to explore the most promising node first, often based on a heuristic.
   - **Hill Climbing**
     - A local search algorithm that continuously moves to the best neighboring state.
     - Can get stuck in local optima.

2. **State Space and Puzzle Problems**
   - **5-Puzzle**
     - A sliding puzzle with 5 tiles and one empty space.
     - States are represented in row-major format.
     - Moves are reversible, and every state has a limited number of neighbors.
   - **Manhattan Distance**
     - A heuristic used in search algorithms to estimate the distance between two points in a grid.

3. **Genetic Algorithms**
   - **Tour Representations**
     - Path representation: A sequence of cities visited in order.
     - Adjacency representation: A list of adjacent cities.
     - Ordinal representation: A numerical representation of the tour.
   - **Cycle Crossover**
     - A genetic operator used to produce offspring from two parent tours.
   - **Nearest Neighbor Heuristic**
     - Constructs a tour by repeatedly visiting the nearest unvisited city.
   - **Greedy Heuristic**
     - Constructs a tour by making the locally optimal choice at each step.
   - **Savings Heuristic**
     - Constructs a tour by calculating savings for each pair of cities and merging routes accordingly.

4. **Traveling Salesman Problem (TSP)**
   - **Distance Matrix**
     - A matrix representing the distances between cities.
   - **Edge Costs**
     - Costs associated with traveling between cities.
   - **Heuristics for TSP**
     - Nearest Neighbor, Greedy, and Savings heuristics are used to find approximate solutions to TSP.

#### Important Equations

1. **Manhattan Distance**
   \[
   D = |x_1 - x_2| + |y_1 - y_2|
   \]
   Where \((x_1, y_1)\) and \((x_2, y_2)\) are the coordinates of two points.

2. **Savings in Savings Heuristic**
   \[
   S_{ij} = C_{i0} + C_{0j} - C_{ij}
   \]
   Where \(C_{i0}\) is the cost of traveling from city \(i\) to the fulcrum node, \(C_{0j}\) is the cost of traveling from the fulcrum node to city \(j\), and \(C_{ij}\) is the cost of traveling directly from city \(i\) to city \(j\).

